  true,\n\t\"url\": null,\n\t\"notes\": \"The 2006 National Footprint Accounts (NFA)
  portion of the Compendium of Environmental Sustainability Indicator Collections,
  version 1.1 is a data set that measures how much land and water area a human population
  requires to produce the resources it consumes and to absorb its wastes under prevailing
  technology and management. It includes Footprints for cropland, grazing land, carbon,
  nuclear, forest, built-up and fishing ground for 147 countries. It also identifies
  countries that are considered to have ecological deficits and reserves. These data
  are drawn from the National Footprint Accounts, 2006 Edition, produced by the Global
  Footprint Network and distributed by the Columbia University Center for International
  Earth Science Information Network (CIESIN).\",\n\t\"license_title\": \"U.S. Government
